import React from 'react';
import './Home.css';

// Import các components con
import Hero from '../../pages/Hero/ ';
import Welcome from '../../pages/Home/Home.js';
import ParentTestimonials from '../../pages/Home/ParentTestimonials';
import FeaturedCourses from '../../pages/Home/FeaturedCourses';
import ContactSection from '../../pages/Home/ContactSection';

const Home = () => {
  return (
    <div className="home-page">
      {/* Hero Section - Banner chính */}
      <Hero />

      {/* Welcome Section - Chào mừng đến với TechKids */}
      <Welcome />

      {/* Parent Testimonials - Ý kiến phụ huynh */}
      <ParentTestimonials />

      {/* Featured Courses - Khóa học nổi bật */}
      <FeaturedCourses />

      {/* Contact Section - Liên hệ */}
      <ContactSection />
    </div>
  );
};

export default Home;
